    data: |
      SELECT DISTINCT col2 AS col2 FROM tab2 (FORMAT parquet) WHERE 90 - 73 + 87 IN ( + - col2 + + + CAST ( NULL AS INTEGER ) * + ( + col0 ) * + - ( - + 74 ) + + col0 * - 11 * - col2 );
  - name: tab2

outputs:
  - name: q1645.out
    data: |
